import Box from "@mui/material/Box";
import { TreeViewBaseItem } from "@mui/x-tree-view/models";
import { RichTreeView } from "@mui/x-tree-view/RichTreeView";

const treeTag = () => {
  return <div onClick={(e) => {}}>yea</div>;
};

const MUI_X_PRODUCTS = [
  {
    id: "grid",
    label: "phonemes",
    children: [
      {
        id: "grid-community",
        label: "vowels",
        children: [
          {
            id: "grid-community2",
            label: "unrounded",
            children: [
              {
                id: "grid-community10",
                label: "front",
                children: [
                  { id: "hh-4", label: "i" },
                  { id: "hh-5", label: "e" },
                  { id: "hh-6", label: "ɛ" },
                  { id: "hh-7", label: "æ" },
                  { id: "hh-8", label: "a" },
                ],
              },
              { id: "grid-community11", label: "near-front" },
              { id: "grid-community12", label: "central" },
              { id: "grid-community13", label: "back" },
            ],
          },
          {
            id: "grid-community3",
            label: "rounded",
            children: [
              { id: "grid-community4", label: "front" },
              { id: "grid-community5", label: "near-front" },
              { id: "grid-community6", label: "central" },
              { id: "grid-community7", label: "near-back" },
              { id: "grid-community8", label: "back" },
            ],
          },
        ],
      },
      { id: "grid-pro", label: "consonants" },
      { id: "grid-premium", label: "other" },
    ],
  },
];

function PhonemeDropDown() {
  return (
    <Box
      sx={{
        minHeight: 33,
        flexGrow: 1,
        backgroundColor: "white",
        boxShadow: "5px 5px 10px gray",
        borderRadius: "5px",
        overflowY: "scroll",
        overflow: "auto",
        maxHeight: "65%",
      }}
      className="phone-drop"
    >
      <RichTreeView items={MUI_X_PRODUCTS} />
    </Box>
  );
}

export default PhonemeDropDown;
